1 If an offender fulfils the requirements for an in-patient therapeutic measure in terms of Articles 59–61 before or during the execution of a custodial sentence or of indefinite incarceration in accordance with Article 64 paragraph 1, the court may order this measure retrospectively. The competent court is the court that imposed the sentence or ordered indefinite incarceration. The execution of any remainder of the sentence is deferred.
2 If during the execution of the custodial sentence, new information or evidence comes to light to the effect that the requirements for indefinite incarceration are fulfilled and already applied at the time of conviction although the court could not have had knowledge of this, the court may order indefinite incarceration retrospectively. Jurisdiction and procedure are determined by the rules that apply to re-opening a case.

Section Two: Other Measures
Art. 66
1. Good behaviour bond
1 If there is the risk that a person will commit a felony or misdemeanour that he has threatened to commit, or if a person convicted of a felony or of a misdemeanour indicates the clear intention to repeat the offence, the court may, at the request of the person threatened, obtain a promise from the offender that he will not commit the offence and require him to deposit appropriate security therefor.
2 If he refuses to make the promise, or fails to deposit the security within the specified period, the court may require him to make the promise or deposit the security by imposing a period of detention for security reasons. The period of detention for security reasons may not be for more than two months. It is executed in the same way as a short custodial sentence (Art. 79).
3 If the offender commits the felony or the misdemeanour within two years of depositing the security, the security is forfeited to the State. If no offence is committed, the security is returned.
Art. 66a
1a. Expulsion.
a. Mandatory expulsion
1 The court shall expel foreign nationals from Switzerland for a period of 5–15 years if they are convicted of any of the following offences, irrespective of the sentence imposed:
a.	intentional homicide (Art. 111), murder (Art. 112), manslaughter (Art. 113), inciting and assisting suicide (Art. 115), illegal abortion (Art. 118 para. 1 and 2);
b.	serious assault (Art. 122), female genital mutilation (Art. 124 para. 1), abandonment (Art. 127), endangering life (Art. 129), attack (Art. 134); 
c.	aggravated misappropriation (Art. 138 para. 2), aggravated theft (Art. 139 para. 2 and 3), robbery (Art. 140), fraud for commercial gain (Art. 146 para. 2), computer fraud for commercial gain (Art. 147 para. 2), misuse of a cheque card or credit card for commercial gain (Art. 148 para. 2), aggravated extortion (Art. 156 para. 2–4), profiteering for commercial gain (Art. 157 para. 2), handling stolen goods for commercial gain (Art. 160 para. 2);
d.	theft (Art. 139) in conjunction with unlawful entry (Art. 186);
e.	fraud (Art. 146 para. 1) related to social insurance or social assistance, unlawful claims for social insurance or social assistance benefits (Art. 148a para. 1);
f.	fraud (Art. 146 para. 1), fraud in relation to administrative services and charges (Art. 14 para. 1, 2 and 4 of the Federal Act of 22 March 1974 on Administrative Criminal Law) or tax fraud, misappropriation of taxes deducted at source or any other offence related to public charges that carries a maximum penalty of a one-year custodial sentence or more;
g.	forced marriage, forced registered partnership (Art. 181a), trafficking in human beings (Art. 182), false imprisonment and abduction (Art. 183), aggravated false imprisonment and abduction (Art. 184), hostage taking (Art. 185); 
h.	sexual acts with children (Art. 187 para. 1), indecent assault (Art. 189), rape (Art. 190), sexual acts with persons incapable of judgement or resistance (Art. 191), encouraging prostitution (Art. 195), pornography (Art. 197 para. 4 second sentence); 
i.	arson (Art. 221 para. 1 and 2), wilfully causing an explosion (Art. 223 para. 1 no 1), misuse of explosives and toxic gases with criminal intent (Art. 224 para. 1), wilfully causing danger without criminal intent (Art.

	extensive destruction and appropriation of property not justified by military necessity and carried out unlawfully and wantonly;
e.	compelling a person to serve in the forces of a hostile power;
f.	unlawful deportation or transfer or unlawful confinement;
g.	denying the right to a fair and regular trial before the imposition or execution of a severe penalty.
2 Acts in terms of paragraph 1 committed in connection with a non-international armed conflict are equivalent to serious violations of international humanitarian law if they are directed against a person or property protected by international humanitarian law.
3 In especially serious cases, and in particular where the offence affects a number of persons or the offender acts in a cruel manner, a custodial sentence of life may be imposed.
4 In less serious cases under paragraph 1 letters c–g, a custodial sentence of not less than one year may be imposed.
Art. 264d
3. Other war crimes
a. Attacks on civilians and civilian objects
1 The penalty is a custodial sentence of not less than three years for any person who in connection with an armed conflict directs an attack:
a.	against the civilian population as such or against individual civilians not taking direct part in hostilities;
b.	against personnel, installations, material or vehicles involved in a humanitarian assistance or peacekeeping mission in accordance with the Charter of the United Nations of 26 June 1945, as long as they are entitled to the protection of international humanitarian law;
c.	against civilian objects, undefended settlements or buildings or demilitarised zones that are not military objectives;
d.	against medical units, material or vehicles using a distinctive emblem under international humanitarian law or whose protected character is recognisable even without a distinctive emblem, hospitals and places where the sick and wounded are collected;
e.	against cultural property or persons entrusted with its protection or vehicles for its transport, against buildings dedicated to religion, education, art, science or charitable purposes, provided they are protected by international humanitarian law.
2 In especially serious cases of attacks on persons, a custodial sentence of life may be imposed.
3 In less serious cases, a custodial sentence of not less than one year may be imposed.
Art. 264e
b. Unjustified medical treatment, violation of sexual rights and human dignity
1 The penalty is a custodial sentence of not less than three years for any person who, in connection with an armed conflict:
a.	causes severe pain or suffering or serious injury or danger, whether physical or mental, to a person protected by international humanitarian law by subjecting that person to a medical procedure that is not justified by the state of his or her health and which does comply with generally recognised medical principles;
b.	rapes a person of the female gender protected by international humanitarian law or, after she has been forcibly made pregnant, confines her unlawfully with the intent of affecting the ethnic composition of a population, forces a person to tolerate a sexual act of comparable severity or forces a person protected by international humanitarian law into prostitution or to be sterilised;
c.	subjects a person protected by international humanitarian law to especially humiliating and degrading treatment.
2 In especially serious cases, and in particular where the offence affects a number of persons or the offender acts in a cruel manner, a custodial sentence of life may be imposed.
3 In less serious cases, a custodial sentence of not less than one year may be imposed.
Art. 264f
c. Recruitment and use of child soldiers
1 The penalty is a custodial sentence of not less than three years for any person who enlists a child under the age of fifteen into armed forces or groups or recruiting them for this purpose or using them to participate in armed conflicts.
2 In especially serious cases, and in particular where the offence affects a number of children or the offender acts in a cruel manner, a custodial sentence of life may be imposed 
3 In less serious cases, a custodial sentence of not less than one year may be imposed.
Art. 264g
d. Prohibited methods of warfare
1 The penalty is a custodial sentence of not less than three years for any person who, in connection with an armed conflict:
a.	launches an attack although he knows or must assume that such an attack will cause loss of life or injury to civilians or damage to civilian objects or widespread, long-term and severe damage to the natural environment which would be clearly excessive in relation to the concrete and direct overall military advantage anticipated;
b.	uses a person protected by international humanitarian law as a human shield in order to influence military operations;
c.	as a method of warfare, pillages or otherwise unlawfully appropriates property or destroys or seizes enemy property in a way not imperatively demanded by the necessities of war, deprives civilians of objects indispensable to their survival or impedes relief supplies;
